import React from 'react';
import {Map, TileLayer, Marker, Popup} from 'react-leaflet';
import MarkerClusterGroup from "react-leaflet-markercluster";
import './map.css';
import 'react-leaflet-markercluster/dist/styles.min.css';
import customData from './data_map.json';
import 'leaflet-providers.js';


import L from 'leaflet';

delete L.Icon.Default.prototype._getIconUrl;

const position = [60.08, 30.33];

function PlaceMarkers() {
  var markers = [];

  // data prossesing, adding markers
  for (var i = 0; i < customData.length; i++) {
    var obj = customData[i];
    var title = obj.loss_probability;

      var icon_url = 'red.png';

      if (parseFloat(obj.loss_probability) <= 20) {
        icon_url = 'green.png';
      } else if (parseFloat(obj.loss_probability) >= 21 && parseFloat(obj.loss_probability) <= 70) {
        icon_url = 'yellow.png';
      }

  const m_icon =   new L.Icon({
      iconUrl: require('./img/' + icon_url),
      iconSize: [40, 40]
    });

    markers.push(<Marker position={[obj.lat, obj.lon]} key={i}  icon={m_icon} ></Marker>);

}

  return (markers)
}
export default function() {
  return (<Map className="markercluster-map"   center={position} zoom={16}>
    <TileLayer url="https://{s}.tile.jawg.io/jawg-light/{z}/{x}/{y}{r}.png?access-token={i9VRGAKkcD1ZGlnrZpTkKxvBHtSK71BP6jcdCSd0kB3Z3qxz93fSlBfhANTwVsXC}" attribution="&copy; <a href=&quot;http://osm.org/copyright&quot;>OpenStreetMap</a> contributors" accessToken="i9VRGAKkcD1ZGlnrZpTkKxvBHtSK71BP6jcdCSd0kB3Z3qxz93fSlBfhANTwVsXC"/>
    <MarkerClusterGroup>
      <PlaceMarkers/>
    </MarkerClusterGroup>

  </Map>)
}
